import React, { Component } from 'react'

class List extends Component {
    render() {
        const listItem = ['MONSTER ULTRA CITRON']
        const renderList = listItem.map((item, index) => <li key={index}>{item}</li>)
        return (
            <div>{renderList}</div>
        )
    }
}

export default List
